import { useState, useContext, Fragment } from "react";
import { AuthContext } from "../../context";
import { useForm } from "react-hook-form";
import { useNavigate } from "react-router-dom";

import classes from "./Test.module.css";


const Test = () => {
  // bracket [ 
  //   round [ 
  //     match [

  //     ]
  //   ]
  // ]
  const [bracket, setBracket] = useState([ [ [{'name': 'Bill'}, {'name': 'Tom'}], [{'name': 'Gin'}, {'name': 'Add'}], [{'name': 'Bill'}, {'name': 'Tom'}], [{'name': 'Gin'}, {'name': 'Add'}] ], [ [{'name': 'Bill'}, {'name': 'Add'}] ]]);

  console.log('bracket', bracket);

  return (
    <section>
      <div className={`${classes.bracket}`}>
        {bracket.map((round) => (
          <Fragment>
          <div className={`${classes.column}`}>
          { round.map((match) => (
              <div className={`${classes.match}`}>
                {
                  match.map((team) => (
                    <div className={`${classes.team}`}>
                      {team.name}
                    </div>
                  ))
                }
                <div className={`${classes.match_lines}`}>
                  <div className={`${classes.line} ${classes.one}`}></div>
                </div>
                <div className={`${classes.match_lines} ${classes.alt}`}>
                  <div className={`${classes.line} ${classes.one}`}></div>
                </div>
              </div>
          )
          )}
          <div className={`${classes.column_linee}`}>
            <div className={`${classes.linees_last}`}>
              1
            </div>
            <div className={`${classes.linees}`}>
              1
            </div>
            <div className={`${classes.linees}`}>
              1
            </div>
            <div className={`${classes.linees_last}`}>
              1
            </div>
          </div>
          </div>

        </Fragment>)
        )}
      </div>
    </section>
  );
};

export default Test;
